          shortDescription:
            "🚀 **Welcome to Our Comprehensive HTML \u0026 GitHub Tutorial Using Visual Studio Code!** 🚀\n\n👨‍💻 **What's Inside:**\nJoin us in this in-depth guide where we'll walk you through:\n1. **Setting Up Your Second Repository on GitHub:** Learn step-by-step how to get your project online.\n2. **Configuring Visual Studio Code \u0026 Extensions:** Optimize your development environment for HTML coding.\n3. **Diving into HTML Basics:** Explore the essentials of HTML with our beginner-friendly explanations.\n4. **Project Management with Visual Studio Code:** Discover efficient ways to manage and navigate your projects.\n5. **Understanding Essential HTML Tags:** Get to grips with tags like `html`, `head`, `body`, and more.\n6. **Creating and Committing Files:** Learn how to make commits and manage files in your GitHub repository.\n7. **Exploring Visual Studio Code Features:** Tips on changing settings, using extensions, and optimizing your workflow.\n8. **Launching a Live Server for Real-Time Editing:** See your HTML changes instantly in your browser.\n9. **HTML Tags \u0026 Elements Deep Dive:** Detailed explanations of various HTML tags and their practical applications.\n10. **Introduction to CSS:** A sneak peek into styling your HTML pages in our upcoming tutorials.\n\n🌐 **Real-World Applications:**\n- Discover how to make your HTML page comprehensive and structured.\n- Learn about semantic HTML and its role in web development.\n- Understand the importance of meta tags and responsive design for mobile devices.\n- Dive into creating an effective navigation bar and managing internal links.\n\n📚 **Resources \u0026 Further Learning:**\n- Mozilla Developer Network for HTML tags ([Link])\n- Our GitHub Repository: Follow along and practice with our code ([Link])\n\n💡 **Perfect for Beginners:** Whether you're new to web development or looking to brush up on your skills, this tutorial is tailored to help you grasp the fundamentals of HTML and GitHub in an easy-to-understand format.\n\n🔔 **Don't Miss Our Next Video on CSS:** Subscribe and turn on notifications to stay updated!\n\n👇 **Have Questions or Feedback?** Leave a comment below or reach out to us through our social media channels.\n\nThis is part 4 of a series showing how to make an artist portfolio website from scratch with no coding experience necessary.\n\n0:00 - Open Visual Studio Code\n0:51 - .gitignore file and settings.json\n2:16 - Start Live Server\n3:33 - !DOCTYPE html\n4:40 - Opening and Closing Tags\n5:30 - Anatomy of HTML Element\n6:29 - Head and Body tags\n7:19 - Format on save with Prettier Extension\n7:45 - Paragraph tag\n8:45 - Heading 1 tag\n10:00 - Head tags \n12:00 - Git commit of index.html\n12:27 - Sync changes with remote GitHub repository\n13:22 - Live on the internet\n14:45 - Semantic HTML tags\n16:30 - page2.html\n17:25 - Emmet HTML Boilerplate Shortcut\n17:50 - Meta viewport tag for responsive design\n19:09 - Title tag\n20:00 - Navigation menu\n20:50 - portfolio.html\n22:13 - HTML page structure elements\n23:00 - Footer tag\n23:53 - HTML Tag Wrapper Extension\n24:13 - Section tag\n25:33 - Project file structure\n26:30 - img tag\n28:05 - CSS Responsive Images\n29:35 - Final Git Commit\n30:04 - Sync with GitHub remote repository\n\nArtist Portfolio Website Video Series\n1- Setup Domain and Hosting with GitHub Student Developer Pack and Namecheap - https://youtu.be/CczyuEzmEO0\n\n2 - Enforce HTTPS with GitHub Pages and Namecheap - https://youtu.be/FBtehan5DAo\n\n3 - Setup Visual Studio Code with GitHub Integration - https://youtu.be/_WEyoLuuyYo\n\n4 - Basic HTML Crash Course and Page Structure - https://youtu.be/dk3F9ONez7M\n\n5 - Basic CSS Crash Course - https://youtu.be/KW25-M00YTw\n\n6 - CSS Flexbox - https://youtu.be/km1AL9-Z4CM\n\n7 - CSS Grid - https://youtu.be/nfsI_B4Puyo\n\n8 - Sample Portfolio layouts in HTML and CSS (in production)\n\n9 - Example Portfolio Site from Start to Finish (in production)\n\nLooking for What Make Art merch?\nhttps://teespring.com/stores/what-make-art\n\nOther links for your browsing.\n\nWhat Make Art? on Twitter:\nhttps://twitter.com/whatmakeart\n\nWhat Make Art? on Instagram:\nhttps://www.instagram.com/whatmakeart/\n\n#html\n#webdesign\n#codingforbeginners\n\nYou can support this channel on Patreon! Thanks to contributions from viewers like you, What Make Art? can continue making useful art tutorials for all. If you’d like to join the supporters who help make this content possible, you can find out how at the link below. Thank you for your consideration of support!\n\nhttps://www.patreon.com/WhatMakeArt",

            description: {
              simpleText:
                "🚀 **Welcome to Our Comprehensive HTML \u0026 GitHub Tutorial Using Visual Studio Code!** 🚀\n\n👨‍💻 **What's Inside:**\nJoin us in this in-depth guide where we'll walk you through:\n1. **Setting Up Your Second Repository on GitHub:** Learn step-by-step how to get your project online.\n2. **Configuring Visual Studio Code \u0026 Extensions:** Optimize your development environment for HTML coding.\n3. **Diving into HTML Basics:** Explore the essentials of HTML with our beginner-friendly explanations.\n4. **Project Management with Visual Studio Code:** Discover efficient ways to manage and navigate your projects.\n5. **Understanding Essential HTML Tags:** Get to grips with tags like `html`, `head`, `body`, and more.\n6. **Creating and Committing Files:** Learn how to make commits and manage files in your GitHub repository.\n7. **Exploring Visual Studio Code Features:** Tips on changing settings, using extensions, and optimizing your workflow.\n8. **Launching a Live Server for Real-Time Editing:** See your HTML changes instantly in your browser.\n9. **HTML Tags \u0026 Elements Deep Dive:** Detailed explanations of various HTML tags and their practical applications.\n10. **Introduction to CSS:** A sneak peek into styling your HTML pages in our upcoming tutorials.\n\n🌐 **Real-World Applications:**\n- Discover how to make your HTML page comprehensive and structured.\n- Learn about semantic HTML and its role in web development.\n- Understand the importance of meta tags and responsive design for mobile devices.\n- Dive into creating an effective navigation bar and managing internal links.\n\n📚 **Resources \u0026 Further Learning:**\n- Mozilla Developer Network for HTML tags ([Link])\n- Our GitHub Repository: Follow along and practice with our code ([Link])\n\n💡 **Perfect for Beginners:** Whether you're new to web development or looking to brush up on your skills, this tutorial is tailored to help you grasp the fundamentals of HTML and GitHub in an easy-to-understand format.\n\n🔔 **Don't Miss Our Next Video on CSS:** Subscribe and turn on notifications to stay updated!\n\n👇 **Have Questions or Feedback?** Leave a comment below or reach out to us through our social media channels.\n\nThis is part 4 of a series showing how to make an artist portfolio website from scratch with no coding experience necessary.\n\n0:00 - Open Visual Studio Code\n0:51 - .gitignore file and settings.json\n2:16 - Start Live Server\n3:33 - !DOCTYPE html\n4:40 - Opening and Closing Tags\n5:30 - Anatomy of HTML Element\n6:29 - Head and Body tags\n7:19 - Format on save with Prettier Extension\n7:45 - Paragraph tag\n8:45 - Heading 1 tag\n10:00 - Head tags \n12:00 - Git commit of index.html\n12:27 - Sync changes with remote GitHub repository\n13:22 - Live on the internet\n14:45 - Semantic HTML tags\n16:30 - page2.html\n17:25 - Emmet HTML Boilerplate Shortcut\n17:50 - Meta viewport tag for responsive design\n19:09 - Title tag\n20:00 - Navigation menu\n20:50 - portfolio.html\n22:13 - HTML page structure elements\n23:00 - Footer tag\n23:53 - HTML Tag Wrapper Extension\n24:13 - Section tag\n25:33 - Project file structure\n26:30 - img tag\n28:05 - CSS Responsive Images\n29:35 - Final Git Commit\n30:04 - Sync with GitHub remote repository\n\nArtist Portfolio Website Video Series\n1- Setup Domain and Hosting with GitHub Student Developer Pack and Namecheap - https://youtu.be/CczyuEzmEO0\n\n2 - Enforce HTTPS with GitHub Pages and Namecheap - https://youtu.be/FBtehan5DAo\n\n3 - Setup Visual Studio Code with GitHub Integration - https://youtu.be/_WEyoLuuyYo\n\n4 - Basic HTML Crash Course and Page Structure - https://youtu.be/dk3F9ONez7M\n\n5 - Basic CSS Crash Course - https://youtu.be/KW25-M00YTw\n\n6 - CSS Flexbox - https://youtu.be/km1AL9-Z4CM\n\n7 - CSS Grid - https://youtu.be/nfsI_B4Puyo\n\n8 - Sample Portfolio layouts in HTML and CSS (in production)\n\n9 - Example Portfolio Site from Start to Finish (in production)\n\nLooking for What Make Art merch?\nhttps://teespring.com/stores/what-make-art\n\nOther links for your browsing.\n\nWhat Make Art? on Twitter:\nhttps://twitter.com/whatmakeart\n\nWhat Make Art? on Instagram:\nhttps://www.instagram.com/whatmakeart/\n\n#html\n#webdesign\n#codingforbeginners\n\nYou can support this channel on Patreon! Thanks to contributions from viewers like you, What Make Art? can continue making useful art tutorials for all. If you’d like to join the supporters who help make this content possible, you can find out how at the link below. Thank you for your consideration of support!\n\nhttps://www.patreon.com/WhatMakeArt",

ite from Start to Finish (in production)\n\nLooking for What Make Art merch?\nhttps://teespring.com/stores/what-mak...\n\nOther links for your browsing.\n\nWhat Make Art? on Twitter:\n  / whatmakeart  \n\nWhat Make Art? on Instagram:\n  / whatmakeart  \n\n#html\n#webdesign\n#codingforbeginners\n\nYou can support this channel on Patreon! Thanks to contributions from viewers like you, What Make Art? can continue making useful art tutorials for all. If you’d like to join the supporters who help make this content possible, you can find out how at the link below. Thank you for your consideration of support!\n\n  / whatmakeart  ",

                            "🚀 *Welcome to Our Comprehensive HTML \u0026 GitHub Tutorial Using Visual Studio Code!* 🚀\n\n👨‍💻 *What's Inside:*\nJoin us in this in-depth guide where we'll walk you through:\n1. *Setting Up Your Second Repository on GitHub:* Learn step-by-step how to get your project online.\n2. *Configuring Visual Studio Code \u0026 Extensions:* Optimize your development environment for HTML coding.\n3. *Diving into HTML Basics:* Explore the essentials of HTML with our beginner-friendly explanations.\n4. *Project Management with Visual Studio Code:* Discover efficient ways to manage and navigate your projects.\n5. *Understanding Essential HTML Tags:* Get to grips with tags like `html`, `head`, `body`, and more.\n6. *Creating and Committing Files:* Learn how to make commits and manage files in your GitHub repository.\n7. *Exploring Visual Studio Code Features:* Tips on changing settings, using extensions, and optimizing your workflow.\n8. *Launching a Live Server for Real-Time Editing:* See your HTML changes instantly in your browser.\n9. *HTML Tags \u0026 Elements Deep Dive:* Detailed explanations of various HTML tags and their practical applications.\n10. *Introduction to CSS:* A sneak peek into styling your HTML pages in our upcoming tutorials.\n\n🌐 *Real-World Applications:*\n- Discover how to make your HTML page comprehensive and structured.\n- Learn about semantic HTML and its role in web development.\n- Understand the importance of meta tags and responsive design for mobile devices.\n- Dive into creating an effective navigation bar and managing internal links.\n\n📚 *Resources \u0026 Further Learning:*\n- Mozilla Developer Network for HTML tags ([Link])\n- Our GitHub Repository: Follow along and practice with our code ([Link])\n\n💡 *Perfect for Beginners:* Whether you're new to web development or looking to brush up on your skills, this tutorial is tailored to help you grasp the fundamentals of HTML and GitHub in an easy-to-understand format.\n\n🔔  Site from Start to Finish (in production)\n\nLooking for What Make Art merch?\nhttps://teespring.com/stores/what-mak...\n\nOther links for your browsing.\n\nWhat Make Art? on Twitter:\n  / whatmakeart  \n\nWhat Make Art? on Instagram:\n  / whatmakeart  \n\n#html\n#webdesign\n#codingforbeginners\n\nYou can support this channel on Patreon! Thanks to contributions from viewers like you, What Make Art? can continue making useful art tutorials for all. If you’d like to join the supporters who help make this content possible, you can find out how at the link below. Thank you for your consideration of support!\n\n  / whatmakeart  ",
